import React, { useEffect, useState } from 'react';

const VisionSummary = () => {
  const [achievements, setAchievements] = useState([]);
  const [insights, setInsights] = useState('');
  const [progressData, setProgressData] = useState({ weekly: 0, monthly: 0, yearly: 0 });

  useEffect(() => {
    // טוען נתונים מ-Local Storage
    const savedSummary = localStorage.getItem('visionSummary');
    if (savedSummary) {
      const data = JSON.parse(savedSummary);
      setAchievements(data.achievements || []);
      setInsights(data.insights || '');
      setProgressData(data.progressData || { weekly: 0, monthly: 0, yearly: 0 });
    }
  }, []);

  const saveSummary = () => {
    const summaryData = {
      achievements,
      insights,
      progressData,
    };
    localStorage.setItem('visionSummary', JSON.stringify(summaryData));
    alert('💾 הסיכום נשמר בהצלחה!');
  };

  const resetSummary = () => {
    setAchievements([]);
    setInsights('');
    setProgressData({ weekly: 0, monthly: 0, yearly: 0 });
    localStorage.removeItem('visionSummary');
    alert('🗑️ הסיכום נמחק בהצלחה!');
  };

  return (
    <div className="container mx-auto p-8 bg-gray-50 rounded-md shadow-md">
      <h1 className="text-3xl font-bold mb-6 text-center">📊 סיכום שבועי, חודשי ושנתי 📊</h1>

      {/* הישגים עיקריים */}
      <section className="mb-8">
        <h2 className="text-xl font-bold mb-2">🏆 הישגים עיקריים</h2>
        <ul className="list-disc pl-6">
          {achievements.map((achievement, index) => (
            <li key={index} className="mb-1">{achievement}</li>
          ))}
        </ul>
        <input
          type="text"
          placeholder="הוסף הישג חדש..."
          className="w-full p-2 border rounded-md mt-2"
          onKeyDown={(e) => {
            if (e.key === 'Enter' && e.target.value) {
              setAchievements([...achievements, e.target.value]);
              e.target.value = '';
            }
          }}
        />
      </section>

      {/* תובנות אישיות */}
      <section className="mb-8">
        <h2 className="text-xl font-bold mb-2">💡 תובנות אישיות</h2>
        <textarea
          value={insights}
          onChange={(e) => setInsights(e.target.value)}
          placeholder="כתוב כאן את התובנות שלך..."
          className="w-full h-32 p-2 border rounded-md"
        />
      </section>

      {/* גרף התקדמות */}
      <section className="mb-8">
        <h2 className="text-xl font-bold mb-2">📈 התקדמות לעבר החזון</h2>
        <div className="flex gap-4">
          <div className="w-1/3 text-center">
            <h3>🗓️ שבועי</h3>
            <input
              type="number"
              value={progressData.weekly}
              onChange={(e) => setProgressData({ ...progressData, weekly: e.target.value })}
              className="w-full p-2 border rounded-md"
              max={100}
              min={0}
            />
            <p>{progressData.weekly}% הושלמו</p>
          </div>
          <div className="w-1/3 text-center">
            <h3>📅 חודשי</h3>
            <input
              type="number"
              value={progressData.monthly}
              onChange={(e) => setProgressData({ ...progressData, monthly: e.target.value })}
              className="w-full p-2 border rounded-md"
              max={100}
              min={0}
            />
            <p>{progressData.monthly}% הושלמו</p>
          </div>
          <div className="w-1/3 text-center">
            <h3>🏆 שנתי</h3>
            <input
              type="number"
              value={progressData.yearly}
              onChange={(e) => setProgressData({ ...progressData, yearly: e.target.value })}
              className="w-full p-2 border rounded-md"
              max={100}
              min={0}
            />
            <p>{progressData.yearly}% הושלמו</p>
          </div>
        </div>
      </section>

      {/* כפתורי פעולה */}
      <div className="flex gap-4 justify-center mt-6">
        <button
          onClick={saveSummary}
          className="bg-blue-500 text-white px-4 py-2 rounded-md"
        >
          💾 שמור
        </button>
        <button
          onClick={resetSummary}
          className="bg-red-500 text-white px-4 py-2 rounded-md"
        >
          🗑️ מחק
        </button>
      </div>
    </div>
  );
};

export default VisionSummary;
